exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,cleanNewest}=await require("transcode/parse_catalog"),[py,num]=bid.split("|");return parseCatalog(`https://www.jusen2008.com/jusen${py}sen${num}/`,{cleaner:html=>cleanCatalogWrapper(html,/id="list"[^>]*>/,"</dl>"),recordRegex:/href="(?<url>[^"]*read_\d+\.html)"[^>]*>(?<name>[^<]+)</g},{clientOptions:{...(options&&options.clientOptions)}}).then(cleanNewest)};